$(function() {
	if ($(".inventory").length) {
		$('.inventory').html('<li id="js-loading-inventory" data-from="1"><div class="cssload-container"><div class="cssload-speeding-wheel"></div></div></li>');
	
		$('.inventoryList').on('scroll', function() {
			if($(this).scrollTop() + $(this).innerHeight() >= $(this)[0].scrollHeight-80) {
				if (!inventory_loading && isAndroid() && client.getInventoryLength("") != $('.weapon').length)
					fillInventory();
			}
	
		});
	}
})

function getRandomWeapon(specialClass) {
	if (typeof specialClass == 'undefined') specialClass = 0;
	var randomCaseId = Math.rand(0, cases.length-1);
	
	if ((specialClass == 0) && (typeof cases[randomCaseId].specialClass != "undefined")) {
		randomCaseId = Math.rand(0, cases.length-1);
		while (typeof cases[randomCaseId].specialClass != "undefined") {
			randomCaseId = Math.rand(0, cases.length-1);
		}
	}
	var randomWeaponId = Math.rand(0, cases[randomCaseId].weapons.length-1);
	var wp = cases[randomCaseId].weapons[randomWeaponId]
	
	if (typeof cases[randomCaseId].canBeSouvenir != 'undefined' && cases[randomCaseId].canBeSouvenir)
		wp.type = (Math.rand(0, 10) > 7) ? Localization.souvenir[Settings.language]+' '+wp.type : wp.type;
	
	return cases[randomCaseId].weapons[randomWeaponId];
}

function fillInventory() {
	if ($('#js-loading-inventory').length == 0){
		if (isAndroid()) {
			if ($('.weapon').length != 0) {
				$(".weapon").remove();
				$('.inventory').append('<li id="js-loading-inventory" data-from="1"><div class="cssload-container"><div class="cssload-speeding-wheel"></div></div></li>');
			}
		}
	}
	
	inventory_loading = true;
	var wp_from = parseInt($('#js-loading-inventory').data('from'));
	wp_from = wp_from || 1;
	if (isAndroid()) {
		var inventory = getInventory(wp_from, wp_from+inventory_step-1);
	} else {
		if ($('.weapon').length != 0) 
			$(".weapon").remove();
		var inventory = _getInventoryLocalStorage();
		/*if ($('.weapon').length == inventory.length) {
			inventory_loading = false;
			return false;
		}*/
	}
	
	$("#intentory-Player").html(Localization.jackpot2.playerInventory[Settings.language]);
	$("#js-loading-inventory").remove();
	var need_save = false;
	
	for(var i = 0; i < inventory.length; i++) {
		var weapon = inventory[i];
		
		if (typeof weapon['new'] == 'undefined') 
			weapon['new'] = false;
	
		var type = weapon.type;
		type = (Settings.language == 'RU') ? type.replace(/souvenir/gi, "Сувенир") : type.replace(/Сувенир/gi, "Souvenir");
		
		var name = getSkinName(weapon.skinName, Settings.language);
		var weaponInfo = "<img src='"+getImgUrl(weapon.img)+"'><div class='weaponInfo "+weapon.rarity+"'><span class='type'>"+type+"<br>"+name+		"</span></div><i>"+weapon.price+"$</i>";
		$(".inventory").append("<li class='weapon "+ ((weapon.statTrak == 1) ? "wp-statTrak" : "") +" "+((weapon['new'] == true) ? "new-weapon" : "")+"' id='"+i+"-inventoryItem' data-id='"+weapon.id+"'>"+weaponInfo+"</li>");
		
		if (weapon['new'] == true) {
			inventory[i]['new'] = false;
			if (isAndroid()) updateWeapon(inventory[i]);
			need_save = true;
		}
		inventory_loading = false;
	}
	if (inventory.length == 0) {
		$(".inventory").html("<li>"+Localization.jackpot2.emptyInventory[Settings.language]+"</li>");
	}
	
	if (isAndroid() && (wp_from+inventory_step) < inventory_length) {
		$('.inventory').append('<li id="js-loading-inventory" data-from="'+(wp_from+inventory_step)+'"><div class="cssload-container"><div class="cssload-speeding-wheel"></div></div></li>');
	}
$(".inventoryList").css("display", "block");
if (need_save && !isAndroid()) saveInventory();
inventory_loading = false;
}

$(document).on("click", ".weapon", function(){
	Sound("selectitem", "play");
	
	var parent = $(this).parent()[0];
	
	if ($(parent).hasClass('inv-no-select')) return false;
	
	if ($(".inventoryItemSelected").length < maxItems) {
		$(this).toggleClass("inventoryItemSelected");
		Sound("selectitems", "play");
	} else if ($(this).hasClass("inventoryItemSelected")) {
		$(this).toggleClass("inventoryItemSelected");
		Sound("selectitems", "play");
	}
	
	if ($(parent).hasClass('inv-price-counter')) {
		if ($("li").is(".inventoryItemSelected")) {
			var sumText = Localization.jackpot2.sumText[Settings.language];
			if ($("div").is("#inventorySum")) {
				var sumPr = 0.0;
				$(".inventoryItemSelected").each(function () {
					sumPr += parseFloat($("i", this).text(), 10)
				});
				$("#inventorySum").html(sumText + sumPr.toFixed(2) + "$");
			} else {
				$(".inventoryList").append("<div id='inventorySum'>" + sumText + $("i", this).text());
			}
		} else {
			$("#inventorySum").remove();
		}
	}
});

function checkForLoadMore() {
	if($(window).scrollTop() + $(window).height() > $(document).height() - 80 && $('#js-loading-inventory').length) {
		var wp_from = parseInt($('#js-loading-inventory').data('from'));
		if (isNaN(wp_from)) wp_from = 1;
		if (!inventory_loading && isAndroid())
			inventoryLoadMore(wp_from);
	}
}

$(document).on("click", '.closeInventory', function(){
	$(".inventoryList").css("display", "none");
	$("#inventorySum").remove();
	if (isAndroid()) $('#js-loading-inventory').remove();
});
var caseId = 0;
var souvenirCase = false;
var caseOpening = false;

$(".openCase").attr("disabled", null);

$(document).on("click", ".case", function () {
	$("#rank-popup").css('display', 'none');
	$('#special-popup').css('display', 'none');
	caseId = $(this).data('case-id');
	souvenir = $(this).data('souvenir');
	if (typeof cases[caseId].minRank != 'undefined' && getRank().id < getRankByName(cases[caseId].minRank).id) {
		needRank = getRankByName(cases[caseId].minRank);
		$("#rank-popup").css('display', 'block');
		$("#rank").html('<img src="' + needRank.img + '" style="width: 50px;">');
		return false;
	}
	if (cases[caseId].type == "Special") {
		
		if (parseInt(getStatistic('specialCases', 0)) >= cases[caseId].casesToOpen) {
			window.location = "open.html?caseId=" + caseId+((souvenir) ? "&souvenir="+souvenir : '');
		} else {
			$('#special-popup').css('display', 'block');
			var needToOpen = cases[caseId].casesToOpen - parseInt(getStatistic('specialCases', 0));
			$('#special').text(needToOpen);
			$('#showVideoAd').data();
			$('.js-secretField').text(caseId);
		}
	} else {
		window.location = "open.html?caseId=" + caseId+((souvenir) ? "&souvenir="+souvenir : '');
	}
});
$(document).on('click', '#closePopup', function () {
	$('.popup').css('display', 'none');
});

function fillCarusel(caseId) {
	var c0 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'consumer'
		}).mul(7).shuffle();
	var a0 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'industrial'
		}).mul(7).shuffle();
	var a1 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'milspec'
		}).mul(5).shuffle();
	var a2 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'restricted'
		}).mul(5).shuffle();
	var a3 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'classified'
		}).mul(4).shuffle();
	var a4 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'covert'
		}).mul(1).shuffle();
	var a5 = cases[caseId].weapons.filter(function (weapon) {
			return weapon.rarity == 'rare'
		}).mul(1).shuffle();

	if ((Math.rand(0, 10) > 7) && (a5.length + a4.length + a2.length + a1.length != 0)) {
		a3 = [];
	}
	if ((Math.rand(0, 10) > 5) && (a5.length + a3.length + a2.length + a1.length != 0)) {
		a4 = [];
	}
	if ((Math.rand(0, 10) > 1) && (a4.length + a3.length + a2.length + a1.length != 0)) {
		a5 = [];
	}

	if (c0 == undefined) {
		var arr = a0.concat(a1, a2, a3, a4, a5).shuffle().shuffle().shuffle();
	} else {
		var arr = c0.concat(a0, a1, a2, a3, a4, a5).shuffle().shuffle().shuffle();
	}
	var el = '';
	while (arr.length <= (winNumber + 3)) {
		arr = arr.concat(a1, a2, a3, a4).shuffle().shuffle();
	}

	if (arr.length > winNumber + 3)
		arr.splice(winNumber + 3, arr.length - (winNumber + 3));
	arr.forEach(function (item, index) {
		var img = getImgUrl(item.img);
		var type = item.type;
		if (type.indexOf("|") != -1) {
			type = type.split("|")[1]
		}
		
		type = $.trim(type.replace(/(Сувенир|Souvenir)/gi, ''));
		if (souvenirCase && !type.match(/(Сувенир|Souvenir)/))
			type = Localization.souvenir[Settings.language] + ' ' + type;

		type = type.replace(/(Сувенир |Souvenir ){2,}/, Localization.souvenir[Settings.language] + ' ')

		if (item.rarity == 'rare') {
			type = '★ Rare Special Item ★';
			name = '&nbsp;';
			img = '../images/Weapons/rare.png';
		} else {
			var name = getSkinName(item.skinName, Settings.language);
		}
		if (item.rarity == 'rare')
			img = '../images/Weapons/rare.png';
		el += '<div class="weapon">' +
		'<img src="' + img + '" />' +
		'<div class="weaponInfo ' + item.rarity + '"><span class="type">' + type + '<br>' + name + '</span></div>' +
		'</div>'
	})

	win = arr[winNumber];
	$(".casesCarusel").html(el);
	$(".casesCarusel").css("margin-left", "0px");
}

$(document).on("click", ".openCase", function () {
	$(".weapons").scrollTop(0);
	if (caseOpening || $(".openCase").text() == Localization.openCase2.opening[Settings.language]) {
		return false
	};
	$(".win").slideUp("slow");
	if ($(".openCase").text() == Localization.openCase2.tryAgain[Settings.language]) {
		backToZero()
	}
	$(".openCase").text(Localization.openCase2.opening[Settings.language]);
	$(".openCase").attr("disabled", "disabled");
	//var a = 1431 + 16*24;
	var a = 127 * winNumber;
	var l = 131;
	var d = 0,
	s = 0;
	var duration = (Settings.drop) ? 5000 : 10000;
	$(".casesCarusel").animate({
		marginLeft : -1 * Math.rand(a - 50, a + 60)
	}, {
		duration : duration,
		easing : 'easeOutCubic',
		start : function () {
			Sound("open", "play", 5);
			var type = win.type;
			var name = getSkinName(win.skinName, Settings.language);
			win.name = name;
			var statTrak = ifStatTrak(type, win.name);
			var quality = getItemQuality()[Settings.language == 'RU' ? 1 : 0];
			caseOpening = true;

			if (type.indexOf("|") != -1) {
				type = type.split("|")[1]
			}
			type = $.trim(type.replace(/(Сувенир|Souvenir)/gi, ''));
			if (souvenirCase && !type.match(/(Сувенир|Souvenir)/))
				type = Localization.souvenir[Settings.language]+' '+type;
			
			type = type.replace(/(Сувенир |Souvenir ){2,}/, Localization.souvenir[Settings.language]+' ')
			
			var price = getPrice(type, name, quality, statTrak);

			win.type = type;

			var stopLoop = 0;
			while (price == 0) {
				quality = getItemQuality()[Settings.language == 'RU' ? 1 : 0];
				price = getPrice(type, name, quality, statTrak);
				if (stopLoop == 15)
					break;
				stopLoop++;
			}

			$(".win_price").html(price + "$");

			if (price == 0)
				getMarketPrice(type, name, quality, statTrak, ".win_price");

			if (statTrak) {
				type = "StatTrak™ " + type;
			}
			$(".win_name").html(type + " | " + name);
			$(".win_quality").html(quality);
			$(".win_img").attr("src", getImgUrl(win.img, 1));
			$(".openCase").attr("disabled", "disabled");
			win.statTrak = statTrak;
			win.quality = quality;
			win.price = price;
			//getInventory();

		},
		progress : function (e, t) {
			if (Settings.sounds) {
				progress_animate = Math.round(100 * t),
				s = parseInt(parseInt($(".casesCarusel").css("marginLeft").replace(/[^0-9.]/g, "") - l / 2) / l),
				s > d && (Sound("scroll", "play"),
					d++)
			}

		},
		complete : function () {
			$("#opened").text(parseInt($("#opened").text()) + 1);
			var price = parseFloat($(".win_price").html());
			if (isNaN(price))
				price = 0;
			win.price = price;
			win['new'] = true;
			inventory.push(win);
			if (isAndroid())
				saveWeapon(win);
			else
				saveInventory();
			Sound("close", "play", 5);
			$(".openCase").text(Localization.openCase2.tryAgain[Settings.language]);
			$(".win").slideDown("fast");
			caseOpening = false;
			$(".openCase").attr("disabled", null);
			$(".weapons").scrollTop(185);

			//Statistic
			changePoints(1);

			var caseId = $("#youCanWin span").text();
			statisticPlusOne('case-' + caseId);
			statisticPlusOne('weapon-' + win.rarity);
			if (win.statTrak)
				statisticPlusOne('statTrak');

			var param = parseURLParams(window.location.href);
			if (typeof param != "undefined") {
				caseId = param.caseId[0];
				var fromAd = 0;
				try {
					fromAd = parseInt(param.fromAd[0]);
				} catch (e) {}

				if (cases[caseId].type == 'Special') {
					if (!fromAd) {
						var need = getStatistic('specialCases', 0) - cases[caseId].casesToOpen;
						need = (need < 0) ? 0 : need;
						saveStatistic('specialCases', need);
					}
					if (getStatistic('specialCases', 0) < cases[caseId].casesToOpen)
						$('.openCase').attr("disabled", "disabled");
				} else {
					statisticPlusOne('specialCases');
				}
			} else {
				statisticPlusOne('specialCases');
			}
		},
		always : function () {
			// $(".openCase").attr("disabled", null);
			caseOpening = false;
		}
	})
})

function backToZero() {
	var l = 131;
	var s = 0,
	d = 0;
	$(".casesCarusel").animate({
		marginLeft : 0
	}, {
		duration : 1000,
		easing : "easeOutQuad",
		start : function () {
			fillCarusel(caseId);
			//caseBackAudio.play();
		},
		always : function () {
			//$(".openCase").attr("disabled", null);
			caseOpening = false;
		}
	})
}

